import React, { useState, useEffect } from 'react';

// --- FILE: Icon.js ---
// This is a helper component for displaying SVG icons.
// You can save this in its own file, e.g., 'components/Icon.js'
const Icon = ({ path, className = "w-6 h-6" }) => (
    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className={className}>
        <path strokeLinecap="round" strokeLinejoin="round" d={path} />
    </svg>
);
const Newsp = () => {
    // Mock data for news articles, inspired by the reference image
    const featuredNews = {
        title: "Major Championship Changes Shake Up the Wrestling World",
        summary: "Unprecedented developments in the championship landscape have left fans and competitors alike stunned as new alliances form and rivalries intensify.",
        category: "Breaking News",
        time: "Just now",
        views: "3.5k",
        imageUrl: "https://placehold.co/1200x600/4a0e6c/ffffff?text=Featured+News"
    };

    const articles = [
        { id: 1, title: "Championship Match Results: New Champion Crowned", summary: "After an intense battle, we have a new champion who dominated the ring with incredible skill and determination.", imageUrl: "https://placehold.co/600x400/1a1a1a/ffffff?text=Event+Recap", time: "1 hour ago", views: "1.2k" },
        { id: 2, title: "Behind the Scenes: Training Regimen Revealed", summary: "Exclusive look at the training methods and dedication required to compete at the highest level.", imageUrl: "https://placehold.co/600x400/1a1a1a/ffffff?text=Training", time: "2 hours ago", views: "890" },
        { id: 3, title: "Upcoming Events: What to Expect This Season", summary: "A comprehensive preview of the exciting matches and events scheduled for the coming months.", imageUrl: "https://placehold.co/600x400/1a1a1a/ffffff?text=Preview", time: "4 hours ago", views: "2.1k" },
    ];

    const categories = ["Match Results", "Interviews", "Behind the Scenes", "Upcoming Events"];

    return (
        <main className="main-content">
            {/* Hero Section */}
            <section className="page-hero">
                <h1 className="page-title">Latest News</h1>
                <p className="page-subtitle">Stay updated with the latest wrestling news, results, and behind-the-scenes content.</p>
                <button className="cta-button purple">
                    <Icon path="M12 7.5h1.5m-1.5 3h1.5m-7.5 3h7.5m-7.5 3h7.5m3-9h3.375c.621 0 1.125.504 1.125 1.125V18a2.25 2.25 0 0 1-2.25 2.25H6.75A2.25 2.25 0 0 1 4.5 18V7.125C4.5 6.504 5.004 6 5.625 6H9" className="w-5 h-5 mr-2"/>
                    Breaking News
                </button>
            </section>

            {/* Featured News */}
            <section className="featured-item purple-border">
                 <div className="featured-tag">FEATURED</div>
                 <h2 className="featured-title">{featuredNews.title}</h2>
                 <p className="featured-summary">{featuredNews.summary}</p>
                 <div className="featured-meta">
                    <span>{featuredNews.time}</span>
                    <span>&bull;</span>
                    <span>{featuredNews.views} views</span>
                 </div>
            </section>

            {/* Articles Grid */}
            <section className="card-grid">
                {articles.map(article => (
                    <div key={article.id} className="content-card news-card">
                        <img src={article.imageUrl} alt={article.title} className="content-card-image" />
                        <div className="content-card-text">
                            <h4>{article.title}</h4>
                            <p>{article.summary}</p>
                            <div className="news-card-meta">
                                <span>{article.time}</span>
                                <span>&bull;</span>
                                <span>{article.views} views</span>
                            </div>
                        </div>
                    </div>
                ))}
            </section>

            {/* Categories Section */}
            <section className="category-section">
                <h3 className="section-title">News Categories</h3>
                <div className="category-tags">
                    {categories.map(cat => <button key={cat} className="category-button purple">{cat}</button>)}
                </div>
            </section>
        </main>
    );
};

export default Newsp
